# 假设我们已经定义了一个函数来读取文件内容
def read_file(ad):
    # 打开文件并读取内容
    with open(ad, 'r') as file:
        # 读取文件的第一行（假设每行都是相同格式）
        line = file.readline()
    # 移除行尾的换行符，并且因为数据是以逗号结束，所以需要处理最后一个元素
    line = line.rstrip(',')

    # 使用逗号作为分隔符分割字符串，并转换为浮点数列表
    F1 = [float(value) for value in line.split(',')]
    # 输出数据
    # print(f'{line}\n')
    return F1


